import { BarChart } from '@mui/x-charts/BarChart';

export default function BasicBars({barchartdata}) {
  return (
    <BarChart
  xAxis={[
    {
      id: 'barCategories',
      data: ['bar A', 'bar B', 'bar C','bar d', 'bar e', 'bar f'],
      scaleType: 'band',
    },
  ]}
  series={[
    {
      data: barchartdata,
    },
  ]}
  width={500}
  height={300}
/>
  );
}
